    <div>
      <p>CLASS OF 2020</p>
      <h2> Paridhi Khaitan</h2>
      <div>
        <img src={require("../images/globeVector.svg")}></img>
        <p>
          {" "}
          <a href="#">PARIDHIKHAITAN.ME</a>
        </p>
      </div>
      <div>
        <img src={require("../images/in.svg")}></img>
        <p>
          {" "}
          <a href="#">PARIDHIKHAITAN.ME</a>
        </p>
      </div>
    </div>
  );
}

export default Member;
